// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.22 <0.9.0;

contract Todolist {
    uint256 beforeDeleteId;
    struct List {
        uint256 id; // id
        uint256 time; // 时间
        uint256 content; // 内容
        address writer; // 写入者
        bool isDone; // 是否完成
    }
    List[] public lists;
    event HanderList(
        uint256 id,
        uint256 time,
        uint256 content,
        address writer,
        bool isDone
    );

    modifier LegalId(uint256 id) {
        require(id >= lists.length, "id no fund");
        require(id < 0, "id no fund");
        _;
    }

    function tianjia(uint content) public returns (bool) {
        lists[beforeDeleteId] = List(
            beforeDeleteId,
            block.timestamp,
            content,
            msg.sender,
            false
        );
        emit HanderList(
            beforeDeleteId,
            block.timestamp,
            content,
            msg.sender,
            false
        );
        if (beforeDeleteId < lists.length) {
            beforeDeleteId++;
        } else {
            beforeDeleteId = lists.length;
        }
    }

    function wancheng(uint256 id) public LegalId(id) returns (bool) {
        List storage list = lists[id];
        require(list.isDone == false);
        list.isDone = false;
        return true;
    }

    function shanchu(uint256 id) public LegalId(id) returns (bool) {
        List storage list = lists[id];
        require(list.isDone == true);
        delete lists[id];
        beforeDeleteId = id;
        return true;
    }
}
